import React from "react";
import { StyleSheet } from "react-native";

const StyleHeadr = StyleSheet.create({
    header :{
        display: "flex",
        width: "100%",
        backgroundColor: '#E7E6E4',
        borderwidth:"1px",
        borderColor : '#A19C91'
    }
});

export default StyleHeadr;
